const WeatherMainInfo = ({ weather }) => {
  return (
    <div>
      <div>{weather?.location.name}</div>
      <div>{weather?.location.country}</div>
      <div>
        <div>
          <img
            src={`http:${weather?.current.condition.icon}`}
            width="128"
            alt={weather?.current.condition.text}
          />
        </div>
        <div>
          <div>{weather?.current.condition.text}</div>
          <div>{weather?.current.condition.temp_c}</div>
        </div>
      </div>
      <div>
       
      <iframe 
      title="mapa"
      src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d753998.1030604208!2d-0.012789443948571936!3d51.62876867738681!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47d8a00baf21de75%3A0x52963a5addd52a99!2sLondres%2C%20Reino%20Unido!5e0!3m2!1ses!2scl!4v1664826771409!5m2!1ses!2scl" width="600" height="450" style={{border:0}} allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
        <iframe title="map" src={`https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4983891.812614316!2d-1.5245217311528272!3d52.4149958968604!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x48670e80ea27ac2f%3A0xa00c7a9973171a0!2sDubl%C3%ADn%2C%20Irlanda!5e0!3m2!1ses!2scl!4v1664825410877!5m2!1ses!2scl`} width="600" height="450" style={{border:0}} allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
      </div>
    </div>
  );
};

